import React from "react";
import type { TodoListProps } from "../types/types";
import TodoItem from "./TodoItem";

const TodoList: React.FC<TodoListProps> = ({
  todosData,
  deleteTodoItem,
  editTodo,
}) => {
  return (
    <section className="todo-list">
      {todosData ? (
        <ul>
          {todosData.map((item) => (
            <li key={item.id}>
              <input type="checkbox" onClick={() => deleteTodoItem(item.id)} />
              <TodoItem todoName={item.name} />
              <button
                className="edit"
                onClick={() => editTodo(item.name, item.id)}
              >
                Edit
              </button>
            </li>
          ))}
        </ul>
      ) : (
        <h3>Loading...</h3>
      )}
    </section>
  );
};

export default TodoList;
